import '../styles/Login.css';
import axios from "axios"
// import homeImage from '../src/static/loginHome.jpeg'
import React from "react";
function App() {

  const handleSubmit = (event) => {
    event.preventDefault();
    const email = document.getElementById('email').value
    const password = document.getElementById("userpassword").value
    var config = {
      method: 'post',
      url: 'http://127.0.0.1:8000/api/login/',
      headers: { 
        'Authorization': 'token 5f1beddc2b0ed77c6980b4a113d740c47b548440'
      },
      data: {"username":email, "password":password}
    };
    axios(config)
    .then(function (response) {
      console.log(response.data);
      // document.getElementById('12').innerHTML = response.data
      // return response.data
    })
    .catch(function (error) {
      console.log(error);
    }); 
  }
  return (
    <div className="container">
      {/* <img src={homeImage} alt="login" className="login-form-image"/> */}
      <form className="input-form" >
        <p className="login-header"> Login into the world of table tennis</p> <br />

        <label>Email</label>
        <input type="email" className="login-form-input" placeholder="Email" name="email" id="email" required/><br /><br />

        <label>Password: </label>
        <input type="password" className="login-form-input" placeholder="Password" name="password" id="userpassword" required/><br /><br />

        <input type="checkbox" id="remember" />
        <label > Remember me</label>

        <p className="login-forget-password"> Forget Password?</p>
        <button type="submit" className="login-submit-button" onClick={handleSubmit}>Login</button>
      </form> 
      {/* <p> New to Table tennis? <a href={''} target="_blank"></a></p> */}
    </div>
  );
}
export default App;
